    const [userData, setData] = useState([]);

    useEffect (() => {
        console.log("EFFECT TRIGGERED");
        axios.get(baseURL).then((response)=>{
            console.log(response);
            setData(response.data);
        })
    }, []);

        return (
            <div> AXIOS TUTORIAL
                {
                    userData.map((data)=>{
                        return (
                            <div>{data.name}</div>
                        )
                    })
                }
            </div>
        )
}

export default AxiosGet;
